import React, {Component} from 'react';

class MyComponent extends Component {
    render(){
        const {title, name} = this.props;

        return(
          <div className="myComponent">
              <h1>Title: {title}</h1>
              <h1>Name: {name}</h1>
          </div>  
        );
    }
}

export default MyComponent;
